import React from "react";
import "../Css/Seeds.css";

function Seeds() {
	const seedsList = [
	  {
	    id: 1,
	    name: "Tomato Seeds",
	    price: 120,
	    img: "https://cdn.pixabay.com/photo/2020/05/15/18/08/tomato-5174148_960_720.jpg"
	  },
	  {
	    id: 2,
	    name: "Chilli Seeds",
	    price: 90,
	    img: "https://cdn.pixabay.com/photo/2017/05/23/20/52/chili-2330375_960_720.jpg"
	  },
	  {
	    id: 3,
	    name: "Groundnut Seeds",
	    price: 150,
	    img: "https://upload.wikimedia.org/wikipedia/commons/8/89/Peanuts_in_shells.jpg"
	  },
	  {
	    id: 4,
	    name: "Corn Seeds",
	    price: 200,
	    img: "https://cdn.pixabay.com/photo/2018/10/01/09/21/corn-3716845_960_720.jpg"
	  },
	  {
	    id: 5,
	    name: "Carrot Seeds",
	    price: 80,
	    img: "https://cdn.pixabay.com/photo/2018/07/12/16/43/carrot-3532132_960_720.jpg"
	  },
	  {
	    id: 6,
	    name: "Onion Seeds",
	    price: 70,
	    img: "https://cdn.pixabay.com/photo/2018/07/25/08/05/onion-3566068_960_720.jpg"
	  },
	  {
	    id: 7,
	    name: "Cabbage Seeds",
	    price: 60,
	    img: "https://cdn.pixabay.com/photo/2020/01/19/18/18/cabbage-4779678_960_720.jpg"
	  },
	  {
	    id: 8,
	    name: "Cauliflower Seeds",
	    price: 75,
	    img: "https://cdn.pixabay.com/photo/2016/08/08/09/17/cauliflower-1575497_960_720.jpg"
	  },
	  {
	    id: 9,
	    name: "Spinach Seeds",
	    price: 50,
	    img: "https://cdn.pixabay.com/photo/2016/06/08/19/26/spinach-1446277_960_720.jpg"
	  },
	  {
	    id: 10,
	    name: "Brinjal Seeds",
	    price: 90,
	    img: "https://cdn.pixabay.com/photo/2017/08/02/20/24/aubergine-2574800_960_720.jpg"
	  },
	  {
	    id: 11,
	    name: "Okra Seeds",
	    price: 85,
	    img: "https://cdn.pixabay.com/photo/2017/07/19/12/39/okra-2518224_960_720.jpg"
	  },
	  {
	    id: 12,
	    name: "Peas Seeds",
	    price: 95,
	    img: "https://cdn.pixabay.com/photo/2016/07/16/17/47/peas-1523310_960_720.jpg"
	  },
	  {
	    id: 13,
	    name: "Pumpkin Seeds",
	    price: 110,
	    img: "https://cdn.pixabay.com/photo/2017/10/26/23/34/hokkaido-2899291_960_720.jpg"
	  },
	  {
	    id: 14,
	    name: "Sunflower Seeds",
	    price: 140,
	    img: "https://cdn.pixabay.com/photo/2017/01/07/20/37/sunflower-seeds-1962654_960_720.jpg"
	  },
	  {
	    id: 15,
	    name: "Mustard Seeds",
	    price: 60,
	    img: "https://cdn.pixabay.com/photo/2017/02/13/15/41/mustard-2069386_960_720.jpg"
	  },
	  {
	    id: 16,
	    name: "Wheat Seeds",
	    price: 45,
	    img: "https://cdn.pixabay.com/photo/2015/12/08/00/32/wheat-1084414_960_720.jpg"
	  },
	  {
	    id: 17,
	    name: "Rice Seeds",
	    price: 55,
	    img: "https://cdn.pixabay.com/photo/2017/08/02/13/16/rice-2572467_960_720.jpg"
	  },
	  {
	    id: 18,
	    name: "Cotton Seeds",
	    price: 180,
	    img: "https://upload.wikimedia.org/wikipedia/commons/4/49/Cotton_bud_%28Gossypium_hirsutum%29.jpg"
	  }
	];


  return (
    <div className="seeds-container">
      <h2 className="seeds-title">
        <i className="fa fa-seedling"></i> Seeds Marketplace
      </h2>

      <div className="seeds-grid">
        {seedsList.map((item) => (
          <div className="seeds-card" key={item.id}>
            <img src={item.img} alt={item.name} className="seeds-img" />

            <h3 className="seeds-name">{item.name}</h3>

            <p className="seeds-price">
              <i className="fa fa-rupee-sign"></i> {item.price}
            </p>

            <button className="seeds-btn">
              <i className="fa fa-shopping-cart"></i> Buy Seeds
            </button>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Seeds;
